import React from "react";
import styled from "styled-components";


const CardBox = styled.div`
    width: 465px;
  height: 500px;
  background-color: gray;
  border-radius:5px;
  box-shadow: 0px 0px 3px 2px  lightgray;
  margin-top: 70px;
  margin-left: 210px;
  position:relative;
  
`
const CardTitle = styled.p`
    font-size: 23px;
  font-weight: 400;
  color: white;
  position: absolute;
  margin-top: 130px;
  margin-left: 175px;
`
const ContentBox = styled.div`
    width: 465px;
    height:210px;
    background-color: white;
    border-radius:0px 0px 5px 5px;
    position: absolute;
   margin-top: 290px;
`
const CardContent = styled.p`
    font-size: 20px;
  font-weight: 500;
  text-align: left;
  margin-top: 20px;
  margin-left: 23px;
  margin-right: 40px;
  line-height: 33px;
`
const CardButton1 = styled.div`
    width: 62px;
    height: 35px;
