const Main = (props) =>{
    return(
        <>
        <MainBox>
          
            <CardBox>
                <CardTitle>{props.cardTitle}</CardTitle>
              <ContentBox>
                <CardContent>{props.cardContent}</CardContent>
                  <CardButton1>
                  <ButtonText1>View</ButtonText1>
                  </CardButton1>
                 <CardButton2>
                  <ButtonText2>Edit</ButtonText2>
                  </CardButton2>
                  <Time>9 mins</Time>
              </ContentBox>
            </CardBox>

            <CardBox2>
                <CardTitle2>{props.cardTitle2}</CardTitle2>
              <ContentBox2>
                <CardContent2>{props.cardContent2}</CardContent2>
                  <CardButton12>
                  <ButtonText12>View</ButtonText12>
                  </CardButton12>
                 <CardButton22>
                  <ButtonText22>Edit</ButtonText22>
                  </CardButton22>
                  <Time2>9 mins</Time2>
              </ContentBox2>
            </CardBox2>
            
            
        </MainBox>
        </>
    )
}
export default Main;
